import 'dart:convert';
import 'dart:typed_data';

import 'package:beautyplugin/beautyplugin.dart';
import 'package:flutter/material.dart';

void main() {
  runApp(MyApp());
}

class MyApp extends StatefulWidget {
  @override
  _MyAppState createState() => _MyAppState();
}

class _MyAppState extends State<MyApp> {
  late String faceInfo =
      "";
  String idPhoto =
      "";

  Map<String, int> fairLevel = {
    "leyelarge": 5,
    "reyelarge": 5,
    "mouthlarge": 5,
    "skinwhite": 5,
    "skinsoft": 5,
    "coseye": 5,
    "facelift": 5
  };
  late Uint8List _bytes;
  late Uint8List image;
  late bool status = true;

  @override
  void initState() {
    super.initState();
  }

  // Platform messages are asynchronous, so we initialize in an async method.
  @override
  Widget build(BuildContext context) {
    return MaterialApp(
      home: Scaffold(
        appBar: AppBar(
          title: const Text('Plugin example app'),
        ),
        body: Center(
          child: status
              ? Container()
              : Image.memory(
                  _bytes,
                  fit: BoxFit.contain,
                ),
        ),
        floatingActionButton: FloatingActionButton(
          onPressed: () async {
            image = Base64Decoder().convert(idPhoto);
            Uint8List bytes =
                await Beautyplugin.beauty(fairLevel, faceInfo, image);
            _bytes = bytes;
            setState(() {
              this.status = false;
            });
          },
        ),
      ),
    );
  }
}
